import React from 'react';
import Nav from './Nav';
import Banner from './Banner';
import requests from './Requests';

function HomeScreen() {
    return (
        <div>
            {/* Nav */}
            <Nav />

            {/* Banner */}
            <Banner />

            {/* Row */}
            <Row title="Netflix Originals"
                 fectchUrl={requests.fetchNetflixOriginals}
                 isLargeRow
            />
            <Row title="Trending"
                 fectchUrl={requests.fetchTrending}
            />
            <Row title="Top Rated"
                 fectchUrl={requests.fetchTrending}
            />
            <Row title="Action Movies"
                 fectchUrl={requests.fetchActionMovies}
            />
            <Row title="Comedy Movies"
                 fectchUrl={requests.fetchComedyMovies}
            />
            <Row title="Horror Movie"
                 fectchUrl={requests.fetchHorrorMovies}
            />
            <Row title="Romance Movie"
                 fectchUrl={requests.fetchRomanceMovies}
            />
            <Row title="Documentaries"
                 fectchUrl={requests.fetchDocumentaries}
            />


        </div>
    )
}

export default HomeScreen;
